import os, base64, zlib, marshal, hashlib, sys

def clear_screen():
    os.system('cls' if os.name=='nt' else 'clear')

def main():
    clear_screen()
    # Load payload
    payload = base64.b64decode("")
    # Verifikasi SHA256
    if hashlib.sha256(payload).hexdigest() != "67d355555fbfff6c489d172b716d7adc3846c8a7f67304b7c69d81c1465cd52b":
        raise ValueError("hash mismatch! File mungkin telah dimodifikasi.")
    # Decode & exec
    code = marshal.loads(zlib.decompress(payload))
    exec(code)

if __name__ == "__main__":
    try:
        main()
    except Exception as e:
        sys.exit(f"Error: {e}")
